Now we can apply the same projection parameters to this dataset:

::: {#b159077a .cell execution_count=6}
``` {.python .cell-code}
ecomap_northpole = alt.Chart(MT2_2).mark_geoshape(
).encode(
    color='occurrence:N'
).project(
    'orthographic',
    rotate=[75, -85, 15]
)
ecomap_northpole
```

